script: |
  super -f tsv -I q9311.sql | sort > q9311.out

vector: true

inputs:
  - name: q9311.sql
    data: |
      SELECT col2 AS col1 FROM tab0 AS cor0 WHERE NOT ( col0 - col0 * - col1 / - col1 ) IN ( - col0 / + col1 + cor0.col0 ) OR NOT NULL NOT IN ( + cor0.col2 + + col0 );
  - name: tab0

outputs:
  - name: q9311.out
    data: |
      1
      33
      82
